Somos a maior plataforma tecnológica do mercado veterinário do Brasil. Oferecemos ferramentas de auxílio e gestão no atendimento veterinário, como: nosso prontuário digital gratuito e informações farmacológicas completas de mais de 4000 medicamentos, alimentos e princípios ativos. Além de conteúdos semanais sobre o mercado veterinário para estudantes e Médicos Veterinários de forma gratuita, de onde estiver e tudo em um só lugar!

CONTEÚDOS EXCLUSIVOS

Confira diversos conteúdos gratuitos como palestras semanais, podcasts e estudos exclusivos sobre medicina veterinária no Vet Smart.

- Palestras gratuitas semanalmente: acompanhe nossas transmissões ao vivo, obtenha certificados e concorra a prêmios exclusivos. Saiba quais são as próximas palestras entrando em nosso site ou aplicativo e aproveite para conferir nosso catálogo com centenas de conteúdos gratuitos sobre temas atualizados e ministrada por professores renomados;

- Podcast de medicina veterinária: ouça de onde estiver, a hora que quiser, nossos episódios que abordam temas variados e relevantes sobre medicina veterinária.

PRONTUÁRIO COMPLETO EM SUAS MÃOS

Experimente os benefícios do nosso prontuário eletrônico, gratuito e acesse pelo computador ou pelo celular. Nele você pode ter acesso rápido dos seus pacientes e gerenciar o cadastro de tutores e animais de forma rápida e fácil, anexar vários tipos de exames e documentos e conferir todo o histórico médico de onde estiver, em um só lugar.

Em nosso prontuário, você também é capaz de criar prescrições personalizáveis de forma digital e na hora de fazer sua prescrição, você pode acessar informações farmacológicas completas de medicamentos, alimentos e princípios ativos. Além disso tudo, suas prescrições podem ser impressas e enviadas por WhatsApp, SMS e e-mail ao tutor, tudo de forma prática e automatizada.

MAIS DE 4 MIL PRODUTOS PARA CONSULTA

Em nosso bulário veterinário totalmente online, você encontra um catálogo de mais de 4.000 produtos de cães e gatos revisados constantemente, além de conferir informações completas sobre medicamentos e alimentos, como:

- Princípios ativos, classificação terapêutica e valores nutricionais;

- Administração e doses (doses recomendadas, via, frequência de utilização, duração de tratamento);

- Apresentações e concentrações;

- Indicações e contraindicações;

- Interações medicamentosas (tipo de interação, grau de interação, efeito clínico, mecanismo de ação e conduta)

- Farmacologia (farmacodinâmica, farmacocinética, efeitos adversos, superdosagem e monitoramento);

- Substâncias ativas, classificação, tipo de receita e espécies relacionadas.

COMUNIDADE DE MÉDICOS VETERINÁRIOS

Pergunte, converse e aprenda com a maior comunidade de Medicina Veterinária do Brasil. Conheça espaços dedicados para o compartilhamento e troca de experiências entre membros da comunidade veterinária do Vet Smart.

My Pregnancy is a week-by-week pregnancy tracker. Our app will help you over the course of your pregnancy. Stay on top of the changes happening inside your body. Find out how your baby is developing.

Our app is completely free and does not contain advertising.

This app includes:
- week-by-week advice;
- useful information on fetal development and changes in your body;
- week-by-week fetal measurements and imaging;
- a to-do list for each trimester;
- a list of things you will need for hospital check-in, post-natal care and check-out;
- a weight tracker you can use to follow weight gain;
- a kick counter;
- a contraction timer;
- and much more

We have created this app with love, specially for young mothers.

This app is not intended for medical use and is not a substitute for medical consultation.

If you have any questions or requests, please write to neumandev@gmail.com. We are eager to hear your comments on how to improve the app.

O Conecte SUS Cidadão é o aplicativo oficial do Ministério da Saúde, onde o cidadão brasileiro pode visualizar as interações realizadas nos pontos de atenção à saúde e acompanhar o seu histórico no Sistema Único de Saúde (SUS), como exames, vacinas, dispensação de medicamentos e localização de estabelecimentos de saúde. 
O cenário de risco à população provocado pela pandemia do novo Coronavírus exigiu respostas contundentes de todo o sistema de saúde, em especial do SUS, para coordenar as ações nacionais e orquestrar os esforços de estados, municípios e, também, da Saúde Suplementar. Diante disso, o Conecte SUS, a partir da implementação da Rede Nacional de Dados em Saúde (RNDS), foi redirecionado para receber e compartilhar informações que auxiliem no controle da situação de emergência da saúde pública, com destaque ao processo de vacinação Covid-19 no Brasil.
Funcionalidades:
Acesse os resultados de exames realizados por qualquer laboratório no território nacional integrado à RNDS para a detecção da Covid-19;
Veja seu histórico de vacinação na Carteira de Vacinação Digital;
*No momento, o Conecte SUS apenas apresenta os dados relacionados à vacinação contra a Covid-19, especificando a data da aplicação, o nome da vacina, o lote, o estabelecimento de saúde e o código do vacinador. Gradativamente serão disponibilizadas as demais vacinas ministradas pelo SUS.
Emita o Certificado Nacional de Vacinação Covid-19 na palma da mão. 
Após as duas doses da vacina (ou a dose única) serem registradas pelos estados ou municípios na RNDS¹, é possível emitir o certificado em pdf nos idiomas português, inglês e espanhol. Esse documento é válido em todo território nacional e pode ser autenticado gratuitamente, utilizando o leitor ValidaQRCode no próprio aplicativo ou digitando o código do documento em:
 https://validacertidao.saude.gov.br/;
*No certificado é especificado os dados cadastrais da pessoa vacinada (nome, data de nascimento, sexo, CPF), data e horário de emissão, além de informações sobre as doses administradas, como a data de aplicação, nome da vacina, lote e estabelecimento de saúde. 
Acesse o histórico de internação hospitalar no SUS;
*Dados a partir de abril de 2018.
·      Veja os medicamentos dispensados pela Farmácia Popular;
Localize rapidamente os estabelecimentos mais próximos como os serviços de Saúde Bucal e Doenças Raras;
Consulte dicas nutricionais e de atividades físicas e verifique o Índice de Massa Corporal (IMC) na funcionalidade “Peso Saudável”;

Quer saber mais?
Acesso o Conecte SUS na web em: https://conectesus-paciente.saude.gov.br/
Acesse os portais:
https://www.gov.br/saude/pt-br/assuntos/conecte-sus
https://www.gov.br/pt-br/servicos/certificado-nacional-de-vacinacao-covid-19
https://www.gov.br/saude/pt-br/assuntos/saude-digital
https://www.gov.br/saude/pt-br/assuntos/rnds
¹ Os registros são de responsabilidade dos gestores estaduais e municipais de saúde, que fazem a coleta e envio das informações para a base de dados do Ministério da Saúde. Eles são feitos pelas equipes responsáveis do centro de vacinação ou da unidade de saúde onde a dose foi aplicada. Os dados são inseridos nos sistemas de informação próprios ou integrados à RNDS, no Sistema de Informações do Programa Nacional de Imunizações (SI-PNI) ou Sistema e-SUS Atenção Primária à Saúde (s-SUS APS). Após os dados enviados e processados, são inseridos de forma automática no Conecte SUS, que está disponível pelo celular ou na versão web.

Confira as funcionalidades:
• Fácil visualização dos laudos e imagens;
• Compartilhe ou salve em PDF os resultados;
• Visualize o histórico dos exames, com acompanhamento do laudo evolutivo;
• Consulte orientações gerais dos exames, como por exemplo, tempo de jejum, preparo necessário e valores de referência;
• Localize as nossas unidades, inclusive, com indicação das mais próximas;
• Acesso à conteúdo exclusivo do laboratório através de notícias;
• Central de avisos para comunicar quando um exame estiver disponível;

Foi pensando no seu bem-estar que a SulAmérica reuniu em um só lugar todas as informações sobre seu seguro saúde. Tenha na palma da mão sua carteirinha digital e de seus dependentes. Explore nossa rede referenciada de hospitais, laboratórios e médicos. E com apenas alguns cliques marque consultas médicas e solicite reembolsos.

Legal, né?
Mas o app SulAmérica Saúde vai muito além de pedidos de reembolso, acesso a rede referenciada ou sua carteirinha digital.

Você terá acesso a:

- Agendamento de consultas médicas;
- Atendimento médico online;
- Atendimento médico na tela (plantonista ou especialista) e orientação por telefone;
- Telemedicina;
- Psicólogo na tela;
- Consulta de autorização de procedimentos;
- Solicitação de medicamentos especiais (Quimioterápicos e Imunobiológicos);
- Histórico de atendimento - Seu e de seus dependentes;
- Segunda via de boleto;
- Alteração cadastral;
- Extrato de utilização e informações sobre seu plano de saúde;
- Demonstrativo IR (Imposto de renda);
- Dados de dependentes;
- Dicas sobre vida saudável;
- Informações sobre o uso consciente do seu seguro saúde;
- Links úteis.

E também poderá contar com funcionalidades incríveis:

- Botão de emergência médica;	
- Ter acesso rápido a prontos-socorros mais pertos de você;
- Solicitar orientações em casos de emergências médicas;
- Criar uma lista de favoritos com médicos e parceiros da rede referenciada. Além de ter acesso a um mapa que orienta o caminho mais rápido até eles;
- Consultar farmácias e lista de medicamentos com descontos de até 65%;
- Acompanhar e consultar, inclusive previamente, os detalhes de suas solicitações de reembolso. Além de receber notificações sempre que ocorrer uma atualização no processo.
- Enviar por email sua carteirinha digital e de seus dependentes.  

Baixe agora o aplicativo SulAmérica Saúde e aproveite com praticidade uma ferramenta que vai trazer muito mais comodidade para o seu dia a dia.

